import React from "react";
import classes from "./Preview.module.scss";

import avatar from "../../img/icons.svg#icons-user";
const Preview = () => {
  return (
    <ul className={classes.results}>
      <li className={classes.preview}>
        <a className={classes.preview__link} href="#23456">
          <figure className={classes.preview__fig}>
            <img
              src="https://www.thespruceeats.com/thmb/rkYibdpcITDVH22TxqpIIzne6T8=/940x0/filters:no_upscale():max_bytes(150000):strip_icc():format(webp)/AvocadoEggRolls-12-249294a23e2a43f9b5ffc25cff501a81.jpg"
              alt="Test"
            />
          </figure>
          <div className={classes.preview__data}>
            <h4 className={classes.preview__title}>
              Pasta with Tomato Cream ...
            </h4>
            <p className={classes.preview__publisher}>The Pioneer Woman</p>
            <div className={classes.preview__user__generated}>
              <svg>
                <use href={avatar}></use>
              </svg>
            </div>
          </div>
        </a>
      </li>
    </ul>
  );
};

export default Preview;
